import { useState } from 'react';
import { BrowserRouter as Router, Route }from 'react-router-dom';

function Exercicios() {
  return (
    <Router>
      <div>
        <Route path='/Exercicios' exact component={Exercicios}>
          <div className='sobre'> 
            <div className='num'>
               Exercicios:
            </div>
          </div>
        </Route>
      </div>
    </Router>
  );
}

export default Exercicios;
